// TransactionList.js
import { useState } from 'react';

const TransactionList = () => {
  const [customerId, setCustomerId] = useState('');
  const [startDate, setStartDate] = useState('');
  const [endDate, setEndDate] = useState('');
  const [transactions, setTransactions] = useState([]);

  const fetchTransactions = async () => {
    const response = await fetch(`http://localhost:8080/transactions/${customerId}?startDate=${startDate}&endDate=${endDate}`);
    const data = await response.json();
    setTransactions(data);
  };

  const handleFetchClick = () => {
    fetchTransactions();
  };

  return (
    <div>
      <h2>Transaction List</h2>
      <div>
        <input
          type="text"
          value={customerId}
          onChange={(e) => setCustomerId(e.target.value)}
          placeholder="Customer ID"
        />
        <input
          type="date"
          value={startDate}
          onChange={(e) => setStartDate(e.target.value)}
        />
        <input
          type="date"
          value={endDate}
          onChange={(e) => setEndDate(e.target.value)}
        />
        <button onClick={handleFetchClick}>Fetch Transactions</button>
      </div>
      <ul>
        {transactions.map((transaction) => (
          <li key={transaction.id}>
            Customer ID: {transaction.customerId}, Amount: {transaction.amount}, Points: {transaction.points}
          </li>
        ))}
      </ul>
    </div>
  );
};

export default TransactionList;
